```solidity
pragma solidity ^0.5.0;

contract Contract {
    mapping (address => uint256) public balanceOf;
    mapping (address => mapping (address => uint256)) public allowance;
    address public owner;
    address public dao;
    uint256 public totalSupply;
    mapping (address => bool) public isSeller;
    bool public locked;

    constructor(uint256 initialSupply) public {
        owner = msg.sender;
        totalSupply = initialSupply;
        balanceOf[msg.sender] = initialSupply;
        locked = false;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value);
        require(balanceOf[_to] + _value >= balanceOf[_to]);

        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[_from] >= _value);
        require(balanceOf[_to] + _value >= balanceOf[_to]);
        require(_value <= allowance[_from][msg.sender]);

        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        emit Transfer(_from, _to, _value);
        return true;
    }

    function setOwner(address _newOwner) public {
        require(msg.sender == owner);
        owner = _newOwner;
    }

    function registerSeller(address _seller) public {
        require(msg.sender == owner);
        isSeller[_seller] = true;
    }

    function unregisterSeller(address _seller) public {
        require(msg.sender == owner);
        isSeller[_seller] = false;
    }

    function mint(address _to, uint256 _value) public {
        require(msg.sender == owner);
        require(totalSupply + _value >= totalSupply);

        balanceOf[_to] += _value;
        totalSupply += _value;
        emit Transfer(address(0), _to, _value);
    }

    event Transfer(address indexed _from, address indexed _to, uint256 _value);
    event Approval(address indexed _owner, address indexed _spender, uint256 _value);
}
```

This contract features basic ERC20 functionality (transfer, approve, transferFrom) as well as some additional functions (setOwner, registerSeller, unregisterSeller, mint). Please note that the exact implementation of the contract might differ slightly from the decompiled code.

